import React from 'react';
import './Form.scss';

class Form extends React.Component {
    constructor(props) {
        super(props);
        //initial state of the component
        this.state = {
            words: 'nothing to see here',
        };
    }

    render() {
        return (
            <main>

        <form>
            <input type="text" placeholder="URL" required/>
            <button type="submit" onClick={this.handleSubmit}>Go</button>
            <input type="radio" name="method" value="get" required/>
            <label >GET</label>
            <input type="radio" name="method" value="post"/>
            <label >POST</label>
            <input type="radio" name="method" value="put"/>
            <label >PUT</label>
            <input type="radio" name="method" value="delete"/>
            <label >DELETE</label>
        </form>
            </main>

        );
    }
}

export default Form;
